static int yy_init_globals (void)
{
        /* Initialization is the same as for the non-reentrant scanner.
     * This function is called from csslex_destroy(), so don't allocate here.
     */

    /* We do not touch csslineno unless the option is enabled. */
    csslineno =  1;
    
    (yy_buffer_stack) = 0;
    (yy_buffer_stack_top) = 0;
    (yy_buffer_stack_max) = 0;
    (yy_c_buf_p) = (char *) 0;
    (yy_init) = 0;
    (yy_start) = 0;

/* Defined in main.c */
#ifdef YY_STDINIT
    cssin = stdin;
    cssout = stdout;
#else
    cssin = (FILE *) 0;
    cssout = (FILE *) 0;
#endif

    /* For future reference: Set errno on error, since we are called by
     * csslex_init()
     */
    return 0;
}

/* csslex_destroy is for both reentrant and non-reentrant scanners. */
int csslex_destroy  (void)
{
    
    /* Pop the buffer stack, destroying each element. */
	while(YY_CURRENT_BUFFER){
		css_delete_buffer(YY_CURRENT_BUFFER  );
		YY_CURRENT_BUFFER_LVALUE = NULL;
		csspop_buffer_state();
	}

	/* Destroy the stack itself. */
	cssfree((yy_buffer_stack) );
	(yy_buffer_stack) = NULL;

    /* Reset the globals. This is important in a non-reentrant scanner so the next time
     * csslex() is called, initialization will occur. */
    yy_init_globals( );

    return 0;
}

